import React from "react";

const SobreNosotros = () => {
    return (
        <main style={styles.main}>
            <img
             src="/images/portada.jpg" 
             alt="funny-mind"
             style={styles.image} 
             />
            <h1 style={styles.title}>Sobre Nosotros</h1>
            
        </main>
    );
};

const styles = {
    main: {
        padding: '2rem',
        color: '#fff',
        display: 'flex',
        justifyContent: 'center',
        alingItems: 'center',
        height: '100vh',
        margin: 0
    },
    title: {
        textAling: 'center'
    },
    image: {
        with: '200px',
        height: 'auto',
        borderRadius: '10px'
    }
}

export default SobreNosotros;
